import React from 'react';
import './logIn.css';
import signUp from './signUp/Students.png';


function LogIn() {
    return (
        <div className="signUp">
        <img class="signUp" src={signUp} alt="logInImage"/>
        <h1 class="signUpHeading"></h1>
        </div>
        
    );
}

export default LogIn;
